import React, { Component } from "react";

export default class index extends Component {
  constructor(props) {
    super(props);

    this.state = {
      popup: false
    };
  }

  render() {
    return (
      <div className="main-dashboard-container">
        {this.state.popup === true ? (
          <div className="cat-modal-opacity" />
        ) : null}
        <h3 className="page-title">Categories</h3>
        <button
          type="button"
          className="btn btn-primary add-voucher-btn"
          onClick={() => this.setState({ popup: true })}
        >
          <img
            src="https://png.pngtree.com/svg/20161118/6fc980719c.svg"
            alt="add-modal-icon"
          />
        </button>
        {this.state.popup === true ? (
          <div className="cat-popup-container">
            <div>
              <h3 className="cat-pop-title">Helllo</h3>
            </div>
            <div>
              <input className="form-control cat-pop-input" />
              <button className="btn cat-save-btn">Save</button>
            </div>
          </div>
        ) : null}
        <div className="container-fluid" />
      </div>
    );
  }
}
